description:
Join the millions of people who love the Life Bible App (formerly Tecarta Bible). Our mission is to help people get the most out of their Bibles every day. Start every morning with the verse of the day, daily devotional or daily TouchPoint - answers for life’s most important questions.

Whether you are a beginner or veteran, you can find everything you need to deepen your relationship with God and grow. Start your day inspired with over 36,000 devotionals. If you love what you read, you can easily purchase the devotional and read directly in the app. Choose from over 600 topics like faith, anxiety, spiritual growth, courage, marriage and more. 

Already know what you want to study? Choose from 100+ Study Bibles and Commentaries and get access to study resources like book introductions, personality profiles, maps, charts and more.  Need help understanding a verse or just simply want to know more? With just one tap, find the meaning behind every Bible verse (Explain) or see the verse in other Bible translations (Compare). Easily share with family and friends. 

TOP TRANSLATIONS and STUDY BIBLES
∙ English Translations: NLT, NIV, KJV, ESV, NKJV, NASB and many more;
∙ Study Bibles include LASB, NIV Study Bible, ESV Study Bible, NKJV Study Bible, NASB MacArthur and all the other top selling Study Bibles;
∙ Other languages include Spanish, Portuguese, Korean, French, Chinese and Tagalog.

FEATURES
∙ Designed by developers and designers who love the Bible;
∙ Stream popular translations for free. Download any title for offline access;
∙ Get daily Bible app notifications each morning for the verse of the day and daily devotional;
∙ Over 600 topics for your daily reading. Choose from some of our top reading plans: One-year Bible, The Bible Recap, Chronological Bible, Psalms, Proverbs, Old Testament, New Testament or create your own plan;
∙ Create free 3, 7, 14 or 30 day devotional plans.;
∙ Read and discuss a plan with family and friends using the Group Plan feature;
∙ Search over 40 translations simultaneously to find your Bible verse. Filter to select your favorite Bible translations;
∙ The only Bible app to have the best-selling TouchPoints series available for free. Discover over 350 topics with engaging questions and Scriptures to find Bible answers for life’s most important questions;
∙ Listen using our audio Bibles to study God’s Word on the go;
∙ Explore and try for free all the best-selling Study Bibles as well as top commentaries. Commentaries include Cornerstone Bible Commentary, Life Application Bible Commentary, Thru the Bible Commentary, Jon Courson’s Application Commentary, Believer’s Bible Commentary, Matthew Henry Concise Commentary and the Preacher’s Commentary.
∙ Choose your own unique highlight colors to markup important verses and insights in your Bible app;
∙ Create personal study notes with our “verse notes” feature;
∙ Flip seamlessly between your Bible and notes so you don’t get left behind during church. Rich text editor allows you to bold, underline, indent or create numbered and bulleted lists;
∙ Split the screen so you can see Bibles, Study Bibles, commentaries or personal notes side by side;
∙ Backup & sync your content. Access notes, bookmarks, highlights and purchases across all your mobile and web devices for easy access anywhere;
∙ Customize your settings to change font, font size, and light/dark mode;
∙ Share verses with family and friends via email, text, Twitter or Facebook.

Learn more at https://lifebible.com/features
See our terms at https://tecarta.com/terms
